import numpy as np

def my_func(vector, target_sum):
    # Convert the input string representation of vector to a numpy array
    vector = np.array(vector)

    # Create a dictionary to keep track of the numbers we've seen so far
    seen = {}

    # Iterate over each number in the vector
    for number in vector:
        # Calculate the required complement that when added to the current number equals target_sum
        complement = target_sum - number

        # Check if the complement exists in the seen dictionary
        if complement in seen:
            # Return the pair as soon as we find it
            return (complement, number)

        # Mark the current number as seen by adding it to the dictionary
        seen[number] = True

    # In case no pair is found, though by the problem definition there should be a valid pair
    return (None, None)

